import React from 'react';

function Card(props){
    return (
        <>
        <div className='cards'>
          <div className='card'>
            <img src={props.src} alt="RoyalTreatment" />
            <div className='card_Categories'>
              <span className='card_Info'>{props.category}</span>
              <h3 className='card_Title'>{props.title}</h3>
              <a href={props.link} target="_blank">
                <button>Watch Now</button>
                </a>
            </div>
    
          </div>
        </div>
    
      </>
    );
}

export default Card;
